import { post, _delete } from '@/lin/plugin/axios'

class WayBill {
  async getExpCaseList(data) {
    const res = await post('/dpf/exp/list', data)
    return res
  }

  async updateExpCaseInfo(data) {
    const res = await post('/dpf/exp/update', data)
    return res
  }

  async createExpCaseInfo(data) {
    const res = await post('/dpf/exp/create', data)
    return res
  }

  async deleteExpCase(id) {
    const res = await _delete(`/dpf/exp/${id}`)
    return res
  }

  async getExpOrder(data) {
    const res = await post('/dpf/exp/submit', data)
    return res
  }

  async getLtlCaseList(data) {
    const res = await post('/dpf/ltl/list', data)
    return res
  }

  async updateLtlCaseInfo(data) {
    const res = await post('/dpf/ltl/update', data)
    return res
  }

  async createLtlCaseInfo(data) {
    const res = await post('/dpf/ltl/create', data)
    return res
  }

  async deleteLtlCase(id) {
    const res = await _delete(`/dpf/ltl/${id}`)
    return res
  }

  async getLtlOrder(data) {
    const res = await post('/dpf/ltl/submit', data)
    return res
  }
}

export default new WayBill()
